import React from 'react';
import { View, Image } from 'react-native';
import StyleCentre from './StyleCenter';

const Center =()=>{
    return <View>
        <Image source={{uri:"https://kartinkof.club/uploads/posts/2022-12/1670476230_kartinkof-club-p-kartinki-rofl-5.jpg"}} ></Image>
    </View>
}

